import React from 'react'
import './patro.css'

const Patro = (props) => {
  return (
    <a href={props.patro.url}>
      <div>
          <img src={props.patro.img} />
          <h3>{props.patro.nombre}</h3>
      </div>
    </a>
  )
}

export default Patro
